window.bookSummaryJSON = "<p>A war is coming.</p> <p>Charlotte’s managed to secure a powerful alliance with the shifters, but this comes at a cost. The news of her plans to rescue the females has spread, and many aren’t eager for the control it gives Charlotte’s males.</p> <p>The Queen of Greed has joined forces with the ogres, and they’ve invaded Wrath. She’s dead set on destroying Charlie’s males and everything they’ve been working toward, and the demon kingdoms quickly find themselves divided.</p> <p>Shifting priorities and untimely attacks strain Charlotte’s carefully crafted plan, and the treads that hold everything together quickly begin to unravel.</p>"; 
